import React, { useContext } from "react";
import { UserContext } from "../../App";
import s from "./User.module.css";

const User = () => {
    const { authService } = useContext(UserContext);

    return (
        <div className={s.userContainer}>
            <div className="userInfo">
                {authService.name}
            </div>
        </div>
    )
}

export default User;
